import {useContext, useEffect} from "react";
import {UserContext} from "../UserContext";
import {Link} from "react-router-dom";

export default function ProfileBody() {
    const {user} = useContext(UserContext);

    useEffect(() => {
        console.log(user);
    }, []);

    return (
        <div className="bg-slate-800 p-8 rounded-xl w-2/5 mx-auto mt-32 mb-40">
            <div className="text-center">
                <h2 className="text-2xl font-bold text-white mb-4">Информация о вашем профиле</h2>
                <h3 className="text-gray-400 text-sm"></h3>
            </div>
            <form>
                <div className="mt-3">
                    <label htmlFor="email"
                           className="block text-white  text-sm font-semibold mb-2">E-mail</label>
                    <input type="email"
                           id="email"
                           disabled="true"
                           name="email"
                           value={user.data.email}
                           className="w-full disabled bg-gray-800 text-white border border-gray-700 rounded-md py-2 px-3 focus:outline-none focus:border-blue-500"
                           required/>
                </div>

                <div className="mt-3">
                    <label htmlFor="first_name"
                           className="block text-white  text-sm font-semibold mb-2">E-mail</label>
                    <input type="text"
                           id="first_name"
                           disabled="true"
                           name="first_name"
                           value={user.data.first_name}
                           className="w-full disabled bg-gray-800 text-white border border-gray-700 rounded-md py-2 px-3 focus:outline-none focus:border-blue-500"
                           required/>
                </div>

                <div className="mt-3">
                    <label htmlFor="last_name"
                           className="block text-white  text-sm font-semibold mb-2">E-mail</label>
                    <input type="text"
                           id="last_name"
                           disabled="true"
                           name="last_name"
                           value={user.data.last_name}
                           className="w-full disabled bg-gray-800 text-white border border-gray-700 rounded-md py-2 px-3 focus:outline-none focus:border-blue-500"
                           required/>
                </div>

            </form>
        </div>
    );
}
